create table furnitures (
	id SERIAL,
	type VARCHAR(10) CHECK (type IN ('chair','table','couch','bed','bookshelf','desk','dresser','nightstand','ottoman','bench')),,
	imageUrl VARCHAR(50),
	name VARCHAR(15),
	price DECIMAL(7,2),
	style VARCHAR(18) CHECK (style IN ('Traditional','Modern','Contemporary','Mid-Century Modern','Rustic','Bohemian')),
	height DECIMAL(5,2),
	width DECIMAL(5,2),
	depth DECIMAL(4,2),
	PRIMARY KEY(id,name),
	UNIQUE(type,name)

);
